INSERT INTO `services` (`id`, `serviceName`, `servicePrice`, `serviceSummary`, `serviceDescription`, `serviceVets`, `serviceImage`) VALUES
(1, 'Vaccine', '1,499.00', 'Stimulating an immune response in an animal without causing the disease itself.', 'Vaccines have a long and successful history of preventing and controlling disease. The veterinary vaccines available today represent years of innovative research and meet many of the disease threats faced by pets and farm animals in the UK today. Vaccines work by stimulating an immune response in an animal without causing the disease itself. When healthy animals are vaccinated, their own immune system responds to the vaccine and can remember the infectious agent to which the animal is vaccinated. This means, if appropriately vaccinated animals are then exposed to the pathogen against which they have been vaccinated, they can expect a level of protection from disease.', 'Dr. Chelsea Garcia Team', );
INSERT INTO `services` (`id`, `serviceName`, `servicePrice`, `serviceSummary`, `serviceDescription`, `serviceVets`, `serviceImage`) VALUES
(2, 'Diagnosis and Therapeutic', '1,499.00', 'A diagnostic process to find out the true cause of your pets symptoms.', 'To find out the true cause of your pets symptoms will most often require some diagnostic process. The capacity to run a variety of tests including a CBC, CMP, urinalyses, and other tests that will play a critical role in making sure that your loved one is taken care of. Diagnostic services to regularly monitor your pets health. This enables us to keep track of whats normal for them and spot changes before they manifest into bigger issues. It also provides us with a comparison tool when your pet is feeling unwell, which helps us diagnose your pets more quickly. A variety of therapeutic services can make a difference in your animal, regardless of whether you have a dog, cat, or even a horse. Vets will talk to you about chiropractic adjustments, exercises, and more that can be done to alleviate their pain and improve their range of motion. A service that can help without having to use severe medications or surgery.', 'Dr. Juan Dela Cruz Team', );
INSERT INTO `services` (`id`, `serviceName`, `servicePrice`, `serviceSummary`, `serviceDescription`, `serviceVets`, `serviceImage`) VALUES
(3, 'Surgical', '1,499.00', 'Performing surgery and provide follow-up care to promote healing.', 'Veterinary surgeons examine animals before an operation to determine the type of surgery necessary and the animals ability to withstand treatment. They perform surgery and provide follow up care to promote healing. They administer medications and anesthesia as required. They work as members of an animals total health care team. Veterinary surgeons may have to lift or position animals. They may have to stand for long periods while performing surgery. Depending on where they work and their scope of practice, veterinary surgeons may travel to diagnose and treat their animal patients. They may work evenings, nights and weekends, particularly if on call for emergencies.', 'Dr. Arvin Dela Cruz', );
INSERT INTO `services` (`id`, `serviceName`, `servicePrice`, `serviceSummary`, `serviceDescription`, `serviceVets`, `serviceImage`) VALUES
(4, 'Consultation', '1,499.00', 'Discussing concerns and services about the well-being of pets.', 'In a consultation the vet will discuss with you any concerns that you have about the well-being of your pet and explain in detail what can be done to help your pet to the best possible health outcome. The vets need to ask you a lot of questions about your animal and its environment and it is important for you to be as accurate and detailed as possible as taking this history is a critical part of reaching a correct diagnosis.', 'Dr. Arvin Dela Cruz', );
INSERT INTO `services` (`id`, `serviceName`, `servicePrice`, `serviceSummary`, `serviceDescription`, `serviceVets`, `serviceImage`) VALUES
(5, 'Laboratory', '1,499.00', 'Research on various objects such as blood, cadavers, organs, of veterinary medicine is conducted.', 'It is an institution in which research on various objects such as blood, cadavers, organs, of veterinary medicine is conducted, along with study of their properties, composition, structure, and of the chemical and biological processes occurring in them.', 'Dr. Francesca Cruz Team', );
INSERT INTO `services` (`id`, `serviceName`, `servicePrice`, `serviceSummary`, `serviceDescription`, `serviceVets`, `serviceImage`) VALUES
